// NotFoundPage.js
import React from 'react';
import '../styles/pages/NotFoundStyle.css';

function NotFoundPage() {
    return (
        <div className="not-found-container">
            <h1>404</h1>
            <p>Oops! Page not found.</p>
            <a href="/">Go Home</a>
        </div>
    );
}

export default NotFoundPage;
